import '../App.css';
import AppRouter from './AppRouter';
import React, { useState } from 'react';
import {Link, Router} from 'react-router-dom';
import Home from '../route/home';
import Program from '../route/program';
import Recruit from '../route/recruit';

import '../css/App.css';


function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  return (
    <>
      <header>
        <img src='error' onClick={Home}></img>
        <nav>
          <div onClick={Home}>home</div>
          <div onClick={Program}>program</div>
          <div onClick={Recruit}>recruit</div>
        </nav>
      </header>
      <hr />
      <div>
        <AppRouter />
      </div>

      <footer>
        <h1>contact info</h1>
        <h2>공식 메일 : danjang@ukov.kr<br />
        카카오톡 플러스 친구 : UKOV 대학생벤처기사단</h2>
        <p>copyright&#169;{new Date().getFullYear()} ukov. All right reserved </p>
        <a href='http://www.softbank.co.kr/ko2/'><img src='error'></img></a>
      </footer>
    </>
  );
};

export default App;
